css:
.feedback-status:before {
  text-align: center;
}
.feedback a {
  text-decoration: underline;
}
.feedback .initially-hidden {
  display: none;
}
.feedback ::-webkit-input-placeholder {
  color: #555555;
}
.feedback textarea,
.feedback input[type=text] {
  width: 100%;
  background-color: #2d2f31;
  border: 1px solid rgba(0, 0, 0, 0.5);
  color: #aaaaaa;
  padding: 3.3333333333333335px 5px;
}
.feedback textarea {
  resize: vertical;
}
.feedback label {
  margin-left: 10px;
}
.feedback .email {
  color: #555555;
}
.feedback .sending-error {
  margin-top: 10px;
  color: #ff982d;
}
.feedback button {
  width: 100%;
}
.support-info a {
  text-decoration: underline;
  color: #555555;
}
.support-info ul {
  font-size: 15px;
  padding-left: 1em;
}
.support-info li {
  margin-bottom: 1em;
}
.support-info button {
  width: 100%;
}
